import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
      <div className="App">
      <Header />
      <List />
      </div>
    );
  }

  const Header = () => {
    return (
      <div className="Header">
        <ol>
          <li>Home</li>
          <li>News</li>
          <li>Credits</li>
        </ol>
      </div>
    );
  }

  const List = () => {
    return (
      <div className="List">
        <ul>
          <li>HTML</li>
          <li>CSS</li>
          <li>JS</li>
          <li>React</li>
          <li>Redux</li>
        </ul>
      </div>
    );
  }


export default App;
